import { all } from 'redux-saga/effects';

import AuthSaga from './auth/saga';
import AdminSaga from './admin/saga';
import HomeCategorySaga from './homeCategory/saga';
import QBankMainCategory from './qBankMainCategory/saga';
import QBankSubCategory from './qBankSubCategory/saga';
import DashboardCategory from './DashboardCategory/saga';
import Coupon from './Coupon/saga';
import Student from './Student/saga';
import Testimonials from './Testimonials/saga';
import Announcements from './Announcements/saga';
import Questions from './questions/saga';
import State from './State/saga'
import ExaminationCalendar from './ExaminationCalendar/saga'
import Exams from './exams/saga'
import Exampackage from './Exampackage/saga'
export default function* rootSaga() {
    yield all([
        AuthSaga(),
        AdminSaga(),
        HomeCategorySaga(),
        QBankMainCategory(),
        QBankSubCategory(),
        DashboardCategory(),
        Coupon(),
        Student(),
        Testimonials(),
        Announcements(),
        Questions(),
        State(),
        ExaminationCalendar(),
        Exams(),
        Exampackage()
    ]);
}
